import React from 'react';

const InfoSection = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-around', padding: '40px 20px', backgroundColor: '#f5f5f5', fontSize: '16px', lineHeight: '1.6' }}>
      <div style={{ flex: 1, margin: '0 15px' }}>
        <h2>About the Company</h2>
        <p>
          We are a leading consultancy company with over 20 years of experience in delivering innovative business solutions. Our team of experts is dedicated to helping organizations optimize their operations, improve efficiency, and achieve sustainable growth. We pride ourselves on our client-centric approach and commitment to excellence.
        </p>
      </div>
      <div style={{ flex: 1, margin: '0 15px' }}>
        <h2>Our Featured Services</h2>
        <p>
          Our comprehensive range of services includes strategic planning, operational improvement, technology integration, and change management. We tailor our solutions to meet the unique needs of each client, ensuring measurable results and long-term success. Our expertise spans multiple industries, enabling us to deliver best-in-class consulting services.
        </p>
      </div>
      <div style={{ flex: 1, margin: '0 15px' }}>
        <h2>Our Featured Products</h2>
        <p>
          We offer a suite of innovative software tools and analytics platforms designed to enhance business intelligence and operational efficiency. Our products are developed with the latest technologies and are customizable to fit diverse business requirements. From data visualization to workflow automation, our solutions empower businesses to stay ahead in a competitive market.
        </p>
      </div>
    </div>
  );
};

export default InfoSection;
